import React from 'react';
import './Home.css';
import Header from './Header.js';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Project from './Project.js';

class Home extends React.Component {
  goAbout = () => {
    this.props.history.push("/about");
  }
  goElectry = () => {
    this.props.history.push("/electry");
  }
  goSportsHats = () => {
    this.props.history.push("/sports-hats");
  }
  goChongQingHouse = () => {
    this.props.history.push("/chongqing-house");
  }
  goGooey = () => {
    this.props.history.push("/gooey");
  }
  render() {
    return (
      <div class="home">
        <Header goToHome={this.goToHome} goToAbout={this.goToAbout} page={"home"}/>
        <div class="intro">
        <Container fluid={true}>
          <Row noGutters={true}>
            <Col xs={12} sm={12} md={7}>
              <div>
                <img src="https://i.ibb.co/BNXhKdX/Continuous-one-line-drawing-of-abstract-girl-face-Beauty-women-sketch-hand-drawn-vector-illustration.jpg"/>
              </div>
            </Col>
            <Col xs={12} sm={12} md={5}>
              <div class="hello">
                <div class="title">Hello! I'm YJ.</div>
                <div>I am an aspiring software engineer passionate about the intersection of business and technology.</div>
                <div>   âœ¨ Graduating Brown University with a degree in Computer Science and Economics.</div>
              </div>
            </Col>
          </Row>
        </Container>
        <Project header={"ITERATIVE DESIGN"} title={"hello"}/>

        </div>
      </div>
    );
  }
}

export default Home;
